import React, {Component} from 'react';
import { useParams } from 'react-router-dom';

class View extends Component{
    constructor(props){
        super(props);
    }

    componentDidMount(){
        const {id} = useParams();
        console.log(id);
    }

    render(){
        return(
            <div>Hey is here download view.</div>
        )
    }
}

export default View;
